[素材]<br>
甲材：合成繊維／合成皮革<BR>
靴底：ゴム底<BR>
<hr>
[特徴]<br>
■Fウイズ相当のラスト採用。<br>
（Fは4Eより一回りゆとりのある規格です）<br>
■ファスナーで”ラク”に脱ぎ履き。<br>
■屈曲性、軽量性に配慮したソール設計。<br>
■インナーソールかかと部に低反発スポンジを採用。<br>
■取り外し可能なインナーソールでお手入れがラク。<br>
■夜間の視認性を向上させる反射素材を使用。 <br>
【あす楽対応は北海道のみです】

