ダイヤル操作により、瞬時に最良のフィットが得られるBoaクロージャーシステムを搭載したウォーキングトップモデル「MW880B」が登場。<BR>
米国Boa Technology社によって開発されたワイヤーレースと連動したダイヤルを回すことでシューレースが締まり、望み通りのフィット感に調整することが出来るBoaクロージャーシステムを搭載。<BR>
従来のシューレースを締める・緩めるといった手間を省き、簡単で快適な着脱が可能に。<BR>
軽量性に優れるREVLITEミッドソール、大面積に搭載したABZORBが踵部を包み込み、快適なクッション性を提供します。アウトソールは広い接地面積を確保し、着地から蹴り出しまで抜群の安定性を発揮します。<BR>
ウォーキングシューズに特化したテクノロジーWALKING STRIKE PATHがスムーズな体重移動をアシストします。<BR>
素材 アッパー：アッパー素材：スエード/メッシュ/シンセティックレザー<BR>
ミッドソール：アブゾーブ、レブライト、エナジー<BR>
ソール：ブローンラバー/ソリッドラバー/N durance<BR>
シューズワイズ 4E <BR>
在庫数の更新は随時行っておりますが、お買い上げいただいた商品が、品切れになってしまうこともございます。<BR>万が一入荷予定がない場合は、キャンセルさせていただく場合もございますことをあらかじめご了承ください。<BR>また、インターネット販売各店舗と実店舗それぞれの価格設定は異なっておりセールや、企画内容に連動性はございません。<BR><!--GoQSystemランキング自動更新ツールワイド-->
